#include <boost/test/unit_test.hpp>
#include <string>
#include <random>
#include <vector>

#include <maps/indoor/libs/indoor_positioning/include/geometry.h>
#include <maps/indoor/libs/indoor_positioning/include/spatial_search_tree.h>

using namespace boost::unit_test;
using namespace INDOOR_POSITIONING_NAMESPACE;

namespace bg = boost::geometry;

namespace {

// Function which generates uniform distribution on [min, max]
double random(double min, double max)
{
    static std::mt19937 rng;
    static std::uniform_real_distribution<double> distribution(0, 1);
    return min + (max - min) * distribution(rng);
}

std::vector<XYPoint> generateRandomPoints(const XYBox& box, size_t count)
{
    std::vector<XYPoint> points;
    for(size_t i = 0; i < count; ++i) {
      const auto point = XYPoint{
          random(box.min_corner().x, box.max_corner().x),
          random(box.min_corner().y, box.max_corner().y)};
      points.push_back(point);
    }

    return points;
}

void testWktGeometry(const std::string& wkt)
{
    const auto numPoints = 100000;

    XYMultiPolygon geom;
    bg::read_wkt(wkt, geom);
    bg::correct(geom);

    XYBox box;
    bg::envelope(geom, box);

    std::string reason;
    BOOST_TEST(bg::is_valid(geom, reason), reason);

    SpatialSearchTree tree;

    tree.reset(geom);

    // Testing points
    for(const auto& point : generateRandomPoints(box, numPoints)) {
        const bool bgContains = bg::covered_by(point, geom);
        const bool sstContains = tree.containsPoint(point);
        BOOST_TEST(bgContains == sstContains,
            "Failed point: " << std::setprecision(12) << bg::wkt(point) << ", " <<
            "bg:" << bgContains << ", " <<
            "sst:" << sstContains);
    }
}

} // namespace

